const linkTextures = {
    "tm": "tile_map.png?",
}

let textures = {}

export default function loadImg() {
    for (let i in linkTextures) {
        let imgl = linkTextures[i]
        let gl = new Image()
        gl.src = "./src/" + imgl
        gl.onload = () => {
            if (imgl.endsWith("?")) {
                try {
                    let tc = document.createElement("canvas")
                    let ctx = tc.getContext("2d")
                    let link = "./src/" + imgl.split(".")[0] + ".json"
                    $.getJSON(link, (data) => {
                        function parseImg(field) {
                            tc.width = field.w
                            tc.height = field.h
                            ctx.filter = "none"
                            ctx.drawImage(gl, field.x, field.y, field.w, field.h, 0, 0, field.w, field.h)

                            return {
                                "type": "pattern",
                                "img": ctx.createPattern(tc, "repeat"),
                                "alpha": field.alpha != undefined ? field.alpha : 0
                            }
                        }
                        for (let p in data.packs) {
                            textures[p] = {}
                            for (let f in data.packs[p]) {
                                textures[p][f] = parseImg(data.packs[p][f])
                                textures[p].type = "pack"
                            }
                        }
                        for (let f in data.fields) {
                            textures[f] = parseImg(data.fields[f])
                        }
                        if (data.fields == undefined || data == undefined) {
                            LOL404(i)
                        }
                    }).fail(() => LOL404(i))
                } catch {
                    LOL404(i)
                }
            } else {
                textures[i] = {
                    "type": "img",
                    "img": gl
                }
            }
        }
        gl.onerror = () => LOL404(i)
    }
    return textures
}

function LOL404(i) {
    let error404 = new Image(128, 128)
    error404.src = "data:image/png;base64,"
    textures[i] = {
        "type": "img",
        "img": error404
    }
}
LOL404("LOL404")
textures["LP404"] = {
    "type": "pattern",
    "img": (() => { let a = document.createElement("canvas"), b = a.getContext('2d'); a.width = a.height = 128; b.drawImage(textures["LOL404"].img, 0, 0); return b.createPattern(a, "repeat") })()
}

